import logo from "./logo.svg";
import "./App.css";
import { useEffect, useState } from "react";
import ListaPostaci from "./components/ListaPostaci";
import axios from 'axios'

function App() {
	const [postaci, setPostaci] = useState(null);

	useEffect(() => {
		axios.get("https://rickandmortyapi.com/api/character")
		.then(result => {
			console.log('result from axios', result)
			setPostaci(result)
		})

		// fetch("https://rickandmortyapi.com/api/character")
		// 	.then((response) => response.json())
		// 	.then((data) => {
		// 		console.log('result from fetch', data)
		// 		setPostaci(data)});
	}, []);

	if (!postaci) {
		return <div className="App">
			Brak danych z backendu
			</div>;
	}

	return (
		<div className="App">
			<ListaPostaci postaci={postaci} />
			<KartaPostaci />
		</div>
	);
}

export default App;
